// no Visual Studio or MSBuild is required for compiling
// Requirements: .Net 3.5x and/or .Net 4.x

// Program to show how to use icons and grafics.
// The images are defined as Base64 strings in the source code, so there is no dependency to other files.

// Generating a Base64 string: use Powershell with the script "Material\ImageToBase64.ps1", e.g.
// .\ImageToBase64.ps1 .\deer.jpg > .\deer.txt
// Warning: the Base64 string has to be set on one line in the source code!

/* Compile with:
C:\Windows\Microsoft.NET\Framework\v4.0.30319\csc.exe /target:winexe "05 Bitmap Icon.cs" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\presentationframework.dll" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\windowsbase.dll" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\presentationcore.dll"
or
C:\Windows\Microsoft.NET\Framework\v3.5\csc.exe /target:winexe "05 Bitmap Icon.cs" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\presentationframework.dll" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\windowsbase.dll" /r:"C:\Program Files\Reference Assemblies\Microsoft\Framework\v3.0\presentationcore.dll"
(see https://msdn.microsoft.com/de-de/library/aa970678(v=vs.85).aspx)
*/

using System;
using System.Xml;
using System.Windows;
using System.Windows.Markup;
using System.Windows.Media.Imaging;

public class Programm
{
	// convert BMP or ICO out of Base64 string
/* with .Net 3.5 assigning the icon with this funktion generates a runtime error (with .Net 4.x everything works fine):
	private static BitmapImage Base64Bitmap2Picture(string Base64String)
	{
	  BitmapImage Bitmap = new BitmapImage();
 		Bitmap.BeginInit();
 		byte[] BitmapBytes = Convert.FromBase64String(Base64String);
		System.IO.MemoryStream MemStream = new System.IO.MemoryStream(BitmapBytes, 0, BitmapBytes.Length);
		MemStream.Write(BitmapBytes, 0, BitmapBytes.Length);
 		Bitmap.StreamSource = MemStream;
 		Bitmap.EndInit();
 		Bitmap.Freeze();
 		return Bitmap;
	}
*/

	// convert JPG from Base64 string (PNG or other formats work too, because the source format is automaticly detected)
	private static System.Windows.Media.ImageSource Base64Img2Picture(string Base64String)
	{
 		byte[] BitmapBytes = Convert.FromBase64String(Base64String);
		System.IO.MemoryStream MemStream = new System.IO.MemoryStream(BitmapBytes, 0, BitmapBytes.Length);
		BitmapDecoder BmpDecoder = BitmapDecoder.Create(MemStream, BitmapCreateOptions.PreservePixelFormat, BitmapCacheOption.OnLoad);
		return BmpDecoder.Frames[0];
	}

	// WPF requires STA model. Since C# uses MTA as default, the following compiler directive is required
	[STAThread]
	public static void Main()
	{

		// icon as Base64 coded string (generated from ico file)
		string strIcon = "";

		// picture as Base64 coded string (generated from jpg file)
		string strPicture = "";

		// XAML string that defines the WPF controls
		string strXAML = @"
<Window
   xmlns=""http://schemas.microsoft.com/winfx/2006/xaml/presentation""
   xmlns:x=""http://schemas.microsoft.com/winfx/2006/xaml""
   FontFamily=""Arial"" Foreground=""White"" SizeToContent=""Width""
   Title=""Test program for Windows Presentation Framework"">
   <Grid>
     <Image Name=""Picture"" Margin=""20"" HorizontalAlignment=""Center""/>
     <TextBlock TextAlignment=""Center"" VerticalAlignment=""Center"" Foreground=""Black"" FontSize=""40"" HorizontalAlignment=""Center"">
      <TextBlock.Effect><DropShadowEffect ShadowDepth=""4"" Color=""DarkGray"" BlurRadius=""4""/></TextBlock.Effect>
      Test program for <LineBreak/><LineBreak/>Windows Presentation Framework
     </TextBlock>
   </Grid>
</Window>";

		// prepare XML document
		XmlDocument XAML = new XmlDocument();
		// read XAML string
		XAML.LoadXml(strXAML);
		// and convert to XML
		XmlNodeReader XMLReader = new XmlNodeReader(XAML);
		// generate WPF object tree
		Window objWindow;
		try
		{	// set XAML root object
			objWindow = (Window)XamlReader.Load(XMLReader);
		}
		catch
		{ // XamlReader generates an exception on error in XAML definition
			MessageBox.Show("Error while creating the WPF controls out of the XAML description", "Error", MessageBoxButton.OK, MessageBoxImage.Error);
			return;
		}

		// assing window icon
// with .Net 3.5 assigning the icon with this funktion generates a runtime error (with .Net 4.x everything works fine):
//		objWindow.Icon = Base64Bitmap2Picture(strIcon);
		// this works always
		objWindow.Icon = Base64Img2Picture(strIcon);

		// setting the beckground image, which is the image with the name "Picture"
		System.Windows.Controls.Image objImage = (System.Windows.Controls.Image)objWindow.FindName("Picture");
		objImage.Source = Base64Img2Picture(strPicture);

		// and show WPF window
		objWindow.ShowDialog();
	}
}